    true,nt"url": null,nt"notes": "The Special Supplemental Nutrition Program
    for Women, Infants, and Children (WIC) is administered by the Food and Nutrition
    Service (FNS) of the U.S. Department of Agriculture (USDA). WIC benefits include
    nutritious supplemental foods; nutrition education; counseling, including breastfeeding
    promotion and support; and referrals to health care, social service, and other community
    providers for pregnant, breastfeeding, and postpartum women, infants, and children
    up to the age of 5 years. 1 For women and their unborn children, WIC seeks to improve
    fetal development and reduce the incidence of low birth weight, short gestation,
    and anemia through intervention during the prenatal period. For infants and children,
    WIC seeks to provide nutritious foods during critical times of growth and development
    in an effort to prevent health problems and to improve the health status of these
    children. The reports, including PC2012, contain information on a census of WIC
    participants in April of the reporting year.",nt"license_title": "Creative
